import React from 'react';

const Hero = (props) => {
    return (
        <div className="hero__container">
            <div className="main__hero">
              <h1 className="hero__title">Dalloway's</h1>
              <p className="title__description">-Comida vegetariana hecha en casa-</p>
            </div>
          </div>
    );
}

export default Hero;
